  "五笔在中国是一种很流行的输入法。五笔输入法采用的编码规则是基于汉字的基形或笔画形。五笔和其他基于形状的输入法的主要优点之一是重复率非常低。这一特征在拼音输入系统中是没有的这意味着只有一两个汉字由一个五笔键序列表示。所以您可以更快地输入文本。新的激进或根源机制是发明五笔的王永民教授发明的专利技术。永敏教授从旧机制开发出来。该机制已发展成为兼容简体中文和繁体中文的新编码系统。使用相同的编码和输入规则。五笔的主要特征之一是最后笔画字形识别码用于区分相似形状的字符。根据最后一个部首的形状分配识别码。识别码的目的是帮助用户在三个不同的层次上掌握五笔输入法。键入时字符编码将显示在选择重复代码窗口中。此功能可以帮助您掌握汉字的编码方法。此外您可以随时使用大写或小写Z键作为通配符。Z是唯一未映射到五笔中的角色的键。为了帮助您学习使用五笔您可以按Z键查询系统输入代码。";

var data11 =
  "If you type Chinese on your computer, you most likely use a pinyin-based input method, or some other phonetic typing system. This is an obvious choice as it’s easy to learn and goes hand in hand with your studies of Chinese pronunciation.However, you might start to notice that typing characters is not beneficial for your ability to write them, and the time spent typing may even detract from valuable writing time. Entering Chinese characters through phonetic input methods can also be slow, as there is so much ambiguity for each syllable.The Wubi input method solves these problems. The difference is that it’s a shape-based input method (of which there are many - Wubi is just the one I would recommend). Rather than typing in the pronunciation of characters you want to input, you hit keys assigned to particular strokes or shapes.";

